@1st_infantry Love it! "people familiar" are not solid sources.  I am familiar with a lot of things. 

Top it off "classified basis"? So Bill leaked classifed?

"3 people familiar with the intelligence tell NBC News that there is a classified basis for Nelson's assertion,"

It's hard to tell jokes when the competition from appeal to authority-based, expert-established reality is so fierce. I am going to be the first man in history to change my name to Official Sources.

*adjusts tie*
